INSERT INTO `about_translations` (`id`, `desc`, `locale`, `about_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, '<p>تنويه : لغة الاشارة المصورة والمسجلة في البرنامج معتمدة من الاتحاد النوعي لجمعيات الصم بمصر. مقدمة: إيمانا من الشركة القابضه لكهرباء مصر بدورها في خدمة المجتمع وحقوق الأشخاص ذوي الاعاقة من الاندماج في المجتمع وحقهم في المساواة في الحصول على الخدمات والعروض التي تقدمها الشركة فإنها تقدم مشروع وتطبيقات عالية الأتاحة والتقنية لإتاحة التعريف بخدمات الشركة القابضه لكهرباء مصر لذوي الاعاقة البصرية والسمعية والحركية<span style=\"font-size:12px\">.&nbsp;</span><span style=\"font-size:14px\"><span dir=\"RTL\" lang=\"AR-SA\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">هذا البرنامج تقدمه الشركة القابضه لكهرباء مصر للجميع مجانًا بإتاحة عالية للصم بلغة الاشارة وللمكفوفين بالصوت للتسهيل عليهم في التعرف على كآفة الخدمات والعروض التي تقدمها الشركة ومساعدتهم في الحصول على الخدمات والعروض بسهولة واتاحة توصل الصم مع موظف خدمة العملاء في الفروع مباشرة باستخدام لغة الاشارة.</span></span></span></p>', 'ar', 1, NULL, '2022-01-20 13:54:48', '2022-02-08 14:33:23');
