(1, '<p>ما هي الإجراءات المطلوبة لاستخراج شهادة بيانات تعاقد / مصالحة ؟ قيام المشترك باستيفاء نموذج لطلب الشهادة<br />\r\nسداد الرسوم المقررة<br />\r\nاستلام الشهادة بعد التحقق من المستندات</p>', 'ar', 1, NULL, '2022-01-22 08:02:40', '2022-01-30 12:21:40'),
(2, 'ما هي الفترة الزمنية لاستخراج شهادة بيانات  تعاقد / مصالحة ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها 30 دقيقة', 'ar', 2, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(3, '<p>ما هي الإجراءات المطلوبة لاستخراج شهادة بيانات استهلاك خلال فترة؟</p>\r\n\r\n<p>قيام المشترك باستيفاء نموذج لطلب الشهادة<br />\r\nسداد الرسوم المقررة<br />\r\nستلام الشهادة بعد التحقق من المستندات</p>', 'ar', 3, NULL, '2022-01-22 08:02:40', '2022-02-06 12:09:21'),
(4, '<p>ما هي الفترة الزمنية لاستخراج شهادة بيانات استهلاك خلال فترة؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها 60 دقيقة</p>', 'ar', 4, NULL, '2022-01-22 08:02:40', '2022-02-20 14:17:37'),
(5, 'ما هي الإجراءات المطلوبة لتركيب عداد قانوني لأول مرة؟ قيام المشترك باستيفاء نموزج الطلب<br>سداد الرسوم وقيمة المقايسه<br>التعاقد علي نموذج توريد الطاقه وتركيب العداد', 'ar', 5, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(6, 'ما هي الفترة الزمنية لتركيب عداد قانوني لأول مرة؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها حتي 7 أيام عمل من تاريخ سداد المقاسيه والتعاقد', 'ar', 6, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(7, 'ما هي الإجراءات المطلوبة لتركيب عداد كودي؟ قيام المشترك باستيفاء نموزج الطلب\nسداد الرسوم وقيمة المقايسه<br>تركيب العداد', 'ar', 7, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(8, 'ما هي المستندات المطلوبة لتركيب عداد كودي؟ بطاقة الرقم القومي\nإيصال سداد الممارسة أو محضر المخالفة أو أن يكون مدرجاً بكشوف حصر المخالفين التي تعدها شركات التوزيع', 'ar', 8, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(9, '<p>ما هي الفترة الزمنية لتركيب عداد كودي ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها 7 أيام عمل من تاريخ سداد المقاسيه</p>', 'ar', 9, NULL, '2022-01-22 08:02:40', '2022-02-05 14:50:20'),
(10, 'ما هي الإجراءات المطلوبة لتركيب عداد بدل تالف ؟ استيفاء الطلب\nسداد الرسوم المقرره والتسويات المستحقة ان وجدت\nتركيب العداد', 'ar', 10, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(11, '<p>ما هي الوثائق المطلوبة لتركيب عداد بدل تالف ؟ بطاقة الرقم القومي طلب من المنتفع او مذكرة من القارئ / المحصل والتأكيد بتقرير المعاينة الفنية<br />\r\nبيانات الحساب</p>', 'ar', 11, NULL, '2022-01-22 08:02:40', '2022-02-09 13:25:37'),
(12, 'ما هي الفترة الزمنية لتركيب عداد بدل تالف ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها حتي 3 أيام من تاريخ سداد الرسوم', 'ar', 12, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(13, '<p>ما هي الإجراءات المطلوبة لتركيب عداد بدل فاقد ؟</p>\r\n\r\n<p>استيفاء الطلب سداد الرسوم المقرره والتسويات المستحقة ان وجدت تركيب العداد</p>', 'ar', 13, NULL, '2022-01-22 08:02:40', '2022-02-06 12:10:20'),
(14, '<p>ما هي الوثائق المطلوبة لتركيب عداد بدل فاقد ؟ بطاقة الرقم القومي طلب من المنتفع<br />\r\nمحضر شرطة بفقد العداد بيانات الحساب</p>', 'ar', 14, NULL, '2022-01-22 08:02:40', '2022-02-09 13:25:54'),
(15, 'ما هي الفترة الزمنية لتركيب عداد بدل فاقد ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها حتي 3 أيام من تاريخ تقديم محضر الشرطة', 'ar', 15, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(16, 'ما هي الإجراءات المطلوبة لتغيير اسم صاحب العداد ؟ قيام المشترك باستيفاء نموذج الطلب\nحضور المنتفع الأصلي وتنازله امام المسؤول المختص\nسداد التسويات المستحقة ان وجدت', 'ar', 16, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(17, '<p>ما هي الوثائق المطلوبة لتغيير اسم صاحب العداد ؟ بطاقة الرقم القومي سند الحيازة تنازل رسمي من المشترك السابق أو توكيل<br />\r\nبيانات الحساب</p>', 'ar', 17, NULL, '2022-01-22 08:02:40', '2022-02-09 13:26:17'),
(18, 'ما هي الفترة الزمنية لتغيير اسم صاحب العداد ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها خلال 60 دقيقة', 'ar', 18, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(19, 'ما هي الإجراءات المطلوبة لطلب فحص عداد ؟ استيفاء استمارة طلب الفحص\nرفع العداد وفحصه بالمعمل\nعمل اجراءات تصفية الحساب والتسوية وفقا لقراءة رفع العداد وتقرير المعمل\nسداد الرسوم المقرره', 'ar', 19, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(20, '<p>ما هي الوثائق المطلوبة لطلب فحص عداد ؟ بطاقة الرقم القومي بيانات الحساب</p>', 'ar', 20, NULL, '2022-01-22 08:02:40', '2022-02-09 13:26:36'),
(21, 'ما هي الفترة الزمنية لطلب فحص عداد ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها حتي 3 أيام من سداد رسم الفحص', 'ar', 21, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(22, 'ما هي الإجراءات المطلوبة لطلب رفع عداد ؟ استيفاء استمارة طلب الرفع\nسداد الرسوم المقررة وجميع المستحقات علي العداد إن وجدت\nرفع العداد في حالة تمكين الشركة من الرفع', 'ar', 22, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(23, '<p>ما هي الوثائق المطلوبة لطلب رفع عداد ؟ بطاقة الرقم القومي بيانات الحساب</p>', 'ar', 23, NULL, '2022-01-22 08:02:40', '2022-02-09 13:27:00'),
(24, 'ما هي الفترة الزمنية لطلب رفع عداد ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها حتي 3 أيام عمل', 'ar', 24, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(25, 'ما هي الإجراءات المطلوبة لاستبدال عداد بقدرة أكبر ؟ استيفاء النموذج المخصص لزيادة القدرة\nمعاينة الاحمال والتوصيلات علي الطبيعه\nتصفية مديونية العداد القديم\nسداد الرسوم وتكاليف المقايسة المقررة', 'ar', 25, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(26, '<p>ما هي الوثائق المطلوبة لاستبدال عداد بقدرة أكبر ؟ بطاقة الرقم القومي بيانات الحساب بيانات بالأحمال المطلوب تعذيتها</p>', 'ar', 26, NULL, '2022-01-22 08:02:40', '2022-02-09 13:27:14'),
(27, 'ما هي الفترة الزمنية لاستبدال عداد بقدرة أكبر ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها حتي 7 أيام عمل من سداد قيمة المقاسيه', 'ar', 27, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(28, 'ما هي الإجراءات المطلوبة لتعديل توصيلة ؟ إستيفاء الطلب<br>إجراء المعاينه اللازمة علي الطبيعة\nإعداد المقايسة وتكاليفها وسداد الرسوم المقررة\nتنفيذ التعديل وإنهاء الطلب', 'ar', 28, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(29, '<p>ما هي الوثائق المطلوبة لتعديل توصيلة ؟ طلب تعديل توصيلة<br />\r\nبطاقة الرقم القومي التصاريح المطلوبة فاتورة كهرباء حديثة في حالة التوصيلة الداخليه</p>', 'ar', 29, NULL, '2022-01-22 08:02:40', '2022-02-09 13:22:56'),
(30, 'ما هي الفترة الزمنية لتعديل توصيلة ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها حتي 3 أيام عمل من تاريخ سداد قيمة المقاسيه', 'ar', 30, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(31, 'ما هي الإجراءات المطلوبة لجدولة مديونية علي أقساط شهرية ؟ استيفاء نموذج طلب تقسيط مديونية\nدفع مبلغ 30% كدفعة مقدمة كحد  أدني ', 'ar', 31, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(32, '<p>ما هي الوثائق المطلوبة لجدولة مديونية علي أقساط شهرية ؟ بطاقة الرقم القومي نموذج طلب تقسيط مديونية فاتورة كهرباء حديثة</p>', 'ar', 32, NULL, '2022-01-22 08:02:40', '2022-02-09 13:28:51'),
(33, 'ما هي الفترة الزمنية لجدولة مديونية علي أقساط شهرية ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها خلال 30 دقيقة', 'ar', 33, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(34, 'ما هي الإجراءات المطلوبة لتوصيل التيار الكهربائي للمباني السكنية القانونية ؟ قيام المشترك باستيفاء طلب توصيل الكهرباء<br>إجراء المعاينة على الطبيعة وحساب تكلفة المقايسة و إدراجها للسداد<br>قيام المشترك بسداد قيمة المقايسة واستخراج التصاريح اللازمة للحفر في حالة طلبها<br>تنفيذ المقايسة والانتهاء من الطلب', 'ar', 34, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(35, '<p>ما هي الوثائق المطلوبة لتوصيل التيار الكهربائي للمباني السكنية القانونية ؟ بطاقة الرقم القومي الرخصة والرسومات المعمارية<br />\r\nخطاب من الجهة الإداريه المختصة بالموافقة علي التوصيل سند الحيازة أو الملكية</p>', 'ar', 35, NULL, '2022-01-22 08:02:40', '2022-02-09 13:29:08'),
(36, 'ما هي الفترة الزمنية لتوصيل التيار الكهربائي للمباني السكنية القانونية ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها كما يلي :\nتقديم الطلب - يوم واحد\nعمل المعاينة وإعداد المقاسية وإدراجها للسداد - 8 أيام من تاريخ تقديم الطلب\nتنفيذ المقايسة وتركيب العداد - 9 أيام بعد سداد المقايسة واستخراج تصاريح الحفر\nإجمالي المدة 18 يوم', 'ar', 36, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(37, 'ما هي الإجراءات المطلوبة لتوصيل التيار للمنشأت الاستثمارية ؟ قيام المشترك باستيفاء طلب توصيل الكهرباء<br>إجراء المعاينة على الطبيعة وحساب تكلفة المقايسة و إدراجها للسداد<br>قيام المشترك بسداد قيمة المقايسة واستخراج التصاريح اللازمة للحفر في حالة طلبها<br>تنفيذ المقايسة والانتهاء من الطلب', 'ar', 37, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(38, '<p>ما هي الوثائق المطلوبة لتوصيل التيار للمنشأت الاستثمارية ؟ بطاقة الرقم القومي سند الحيازة<br />\r\nالبطاقة الضريبيه السجل التجاري خطاب الجهة الإداريه المختصة بالموافقة علي توصيل الكهرباء</p>', 'ar', 38, NULL, '2022-01-22 08:02:40', '2022-02-09 13:30:19'),
(39, 'ما هي الفترة الزمنية لتوصيل التيار للمنشأت الاستثمارية ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها كما يلي :\nتقديم الطلب - يوم واحد\nعمل المعاينة وإعداد المقاسية وإدراجها للسداد - 8 أيام من تاريخ تقديم الطلب\nتنفيذ المقايسة وتركيب العداد - 9 أيام بعد سداد المقايسة واستخراج تصاريح الحفر\nإجمالي المدة 18 يوم', 'ar', 39, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(40, 'ما هي الإجراءات المطلوبة لتوصيل تيار مؤقت ؟ قيام المشترك باستيفاء طلب توصيل الكهرباء.<br>\nإجراء المعاينة على الطبيعة وحساب تكلفة المقايسة و إدراجها للسداد<br>قيام المشترك بسداد قيمة المقايسة واستخراج التصاريح اللازمة للحفر في حالة طلبها\nتنفيذ المقايسة وتركيب العداد والانتهاء من الطلب', 'ar', 40, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(41, '<p>ما هي الوثائق المطلوبة لتوصيل تيار مؤقت ؟ بطاقة الرقم القومي<br />\r\nطلب العميل بتركيب عداد بصفة مؤقتة موافقة الجهة الادارية المختصة علي التوصيل المؤقت</p>', 'ar', 41, NULL, '2022-01-22 08:02:40', '2022-02-09 13:30:47'),
(42, 'ما هي الفترة الزمنية لتوصيل تيار مؤقت ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها 3 أيام من تاريخ سداد المقايسة واستخراج التصاريح اللازمة', 'ar', 42, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(43, 'ما هي الإجراءات المطلوبة لسداد دفعه مقدمة تحت الحساب ؟ توريد قيمة الدفعة المقدمة للخزينه\nاستلام ايصال بما تم سدادة', 'ar', 43, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(44, '<p>ما هي الوثائق المطلوبة لسداد دفعه مقدمة تحت الحساب ؟ بيانات الحساب</p>', 'ar', 44, NULL, '2022-01-22 08:02:40', '2022-02-09 13:31:23'),
(45, 'ما هي الفترة الزمنية لسداد دفعه مقدمة تحت الحساب ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها فورا', 'ar', 45, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(46, 'ما هي الإجراءات المطلوبة لشراء لمبات LED ؟ استيفاء طلب شراء لمبات LED\nسداد المديونية المتاخرة في حالة التقسيط', 'ar', 46, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(47, '<p>ما هي الوثائق المطلوبة لسداد دفعه مقدمة تحت الحساب ؟ بطاقة الرقم القومي<br />\r\nبيانات الحساب في حالة التقسيط طلب شراء لمبات</p>', 'ar', 47, NULL, '2022-01-22 08:02:40', '2022-02-09 13:31:56'),
(48, 'ما هي الفترة الزمنية لسداد دفعه مقدمة تحت الحساب ؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها 15 دقيقة', 'ar', 48, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(49, 'ما هي الإجراءات<br>لتغيير نوع النشاط المتعاقد عليه ؟ استيفاء نموذج الطلب\nالمعاينة علي الطبيعة\nسداد الرسوم المقررة', 'ar', 49, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(50, '<p>ما هي الوثائق المطلوبة لتغيير نوع النشاط المتعاقد عليه<br />\r\n؟ بطاقة الرقم القومي إيصال كهرباء حديث البطاقة الضريبيه الخاصة به في حالة النشاط التجاري والصناعي موافقة الجهة الادارية المختصة</p>', 'ar', 50, NULL, '2022-01-22 08:02:40', '2022-02-09 13:32:17'),
(51, 'ما هي الفترة الزمنية لتغيير نوع النشاط المتعاقد عليه<br>؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها 30 دقيقة', 'ar', 51, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(52, 'ما هي الإجراءات<br>لتصحيح قراءة خاطئة ؟ المعاينة علي الطبيعة لفحص العداد ظاهريا\nتعديل القراءة طبقا للقراءة علي الطبيعة\nفي حالة الخطأ يتم إلغاء الإيصالات الخاطئة وتعديلها', 'ar', 52, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(53, '<p>ما هي الوثائق المطلوبة لتصحيح قراءة خاطئة<br />\r\n؟ بطاقة الرقم القومي الايصال الخاطئ</p>', 'ar', 53, NULL, '2022-01-22 08:02:40', '2022-02-09 13:32:38'),
(54, 'ما هي الفترة الزمنية لتصحيح قراءة خاطئة<br>؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها فورا', 'ar', 54, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(55, 'ما هي الإجراءات المطلوبة للإبلاغ عن قراءة العداد ؟ يمكن للمواطن إبلاغ قراءة العداد بنفسه من خلال قنوات متعدده من ضمنها :\n- الخط الساخن 121 الذي يعمل علي مدار الساعة\n- الموقع الألكتروني لشركات التوزيع', 'ar', 55, NULL, '2022-01-22 08:02:40', '2022-01-22 08:02:40'),
(56, '<p>ما هي الوثائق المطلوبة المطلوبة للإبلاغ عن قراءة العداد<br />\r\n؟ بيانات الحساب</p>', 'ar', 56, NULL, '2022-01-22 08:02:41', '2022-02-09 13:33:12'),
(57, 'ما هي الفترة الزمنية المطلوبة للإبلاغ عن قراءة العداد<br>؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها فورا', 'ar', 57, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
(58, '<p>ما هي الوثائق المطلوبة المطلوبة لسداد الفواتير عن طريق منافذ السداد الالكتروني ؟ بيانات الحساب</p>', 'ar', 58, NULL, '2022-01-22 08:02:41', '2022-02-09 13:33:29'),
(59, 'ما هي الفترة الزمنية المطلوبة<br>لسداد الفواتير عن طريق منافذ السداد الالكتروني<br>؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها فورا', 'ar', 59, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
(60, 'ما هي الإجراءات المطلوبة لشحن كارت مسبق الدفع ؟ تقديم كارت الشحن\nشحن الكارت بالقيمة المسددة طبقا للإيصال', 'ar', 60, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
(61, '<p>ما هي الوثائق المطلوبة المطلوبة لشحن كارت مسبق الدفع<br />\r\n؟ كارت شحن</p>', 'ar', 61, NULL, '2022-01-22 08:02:41', '2022-02-09 13:33:53'),
(62, 'ما هي الفترة الزمنية المطلوبة لشحن كارت مسبق الدفع<br>؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها فورا', 'ar', 62, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
(63, 'ما هي الإجراءات المطلوبة لاستخراج کارت شحن بدل تالف او بدل فاقد ؟ استيفاء طلب استخراج كارت شحن بدل تالف او بدل فاقد\nسداد الرسوم المقررة', 'ar', 63, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
(64, '<p>ما هي الوثائق المطلوبة المطلوبة لاستخراج کارت شحن بدل تالف او بدل فاقد<br />\r\n؟ بطاقة الرقم القومي ايصال شحن سابق او كود المشترك<br />\r\nاقرار كتابي بفقد الكارت</p>', 'ar', 64, NULL, '2022-01-22 08:02:41', '2022-02-09 13:34:10'),
(65, 'ما هي الفترة الزمنية المطلوبة لاستخراج کارت شحن بدل تالف او بدل فاقد<br>؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها 25 دقيقة', 'ar', 65, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
(66, 'ما هي الإجراءات المطلوبة لتصحيح اسم وبيانات مشترك ؟ طلب من المنتفع بالتعديل المطلوب\nمراجعة الملف', 'ar', 66, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
(67, '<p>ما هي الوثائق المطلوبة المطلوبة لتصحيح اسم وبيانات مشترك<br />\r\n؟ بطاقة الرقم القومي فاتورة كهرباء حديثة</p>', 'ar', 67, NULL, '2022-01-22 08:02:41', '2022-02-09 13:22:23'),
(68, 'ما هي الفترة الزمنية المطلوبة لتصحيح اسم وبيانات مشترك<br>؟ الفترة الزمنية من طلب الخدمة حتي الوصول إليها فورا', 'ar', 68, NULL, '2022-01-22 08:02:41', '2022-01-22 08:02:41'),
