INSERT INTO `foundation_translations` (`id`, `name`, `desc`, `locale`, `foundation_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'وزارة الكهرباء و الطاقة المتجددة', '<p>أنشئت هيئة كهرباء مصر عام 1976 لتكون مسئولة عن كافة محطات القوى الكهربائية وشبكات نقلها وتوزيعها. وفى عام 2000 صدر القانون 164 بتحويل هيئة كهرباء مصر إلى الشركة القابضة لكهرباء مصر التى صارت تتبعها خمس شركات لإنتاج الكهرباء وسبع شركات لتوزيع الكهرباء وشركة واحدة لنقل الكهرباء والتحكم فيها.</p>\r\n\r\n<p>فى عام 1984 تم إنشاء هيئة القطاع العام لتوزيع القوى االكهربية حيث تولت الإشراف على شركات توزيع الكهرباء . فى عام 1998 تم مرة أخرى نقل تبعية شركات توزيع الكهرباء إلى هيئة كهرباء مصر ، وتم دمج مناطق الكهرباء السبع وشركات توزيع الكهرباء فى سبع شركات مساهمة لإنتاج وتوزيع الطاقة االكهربية.</p>\r\n\r\n<p>فى يوليو عام 2001 تم إعادة هيكلة الشركة القابضة و الشركات التابعة لها حتى أصبح عدد الشركات التابعة ست عشرة شركة ست شركات إنتاج والشركة المصرية لنقل الكهرباء وتسع شركات توزيع.</p>', 'ar', 1, NULL, '2022-01-20 13:55:22', '2022-02-15 14:30:40');
