INSERT INTO `service_translations` (`id`, `title`, `desc`, `locale`, `service_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'شهادة بيانات تعاقد / مصالحة', '<p>طلب المشترك الحصول علي شهاده تفيد أنه متعاقد او متصالح مع شركة التوزيع</p>', 'ar', 2, NULL, '2022-01-20 14:26:47', '2022-01-22 10:58:50'),
(2, 'شهادة بيانات استهلاك خلال فترة', '<p>طلب المشترك الحصول علي شهاده تفيد استهلاكة خلال فترة</p>', 'ar', 3, NULL, '2022-01-20 14:26:47', '2022-01-22 10:59:37'),
(3, 'تركيب عداد', '<p>طلب المشترك تركيب عداد جديد</p>', 'ar', 4, NULL, '2022-01-20 14:26:47', '2022-01-22 10:59:55'),
(4, 'تركيب عداد قانوني لأول مرة', '<p>طلب المشترك تركيب عداد جديد بالوحدة لاول مرة العقار به وصلة أرضية</p>', 'ar', 5, NULL, '2022-01-20 14:26:47', '2022-01-22 11:00:10'),
(5, 'تركيب عداد كودي', '<p>تركيب عداد كودي للمواطنين الذين يستمدون تيار كهربائي بصورة غير فانونية لمحاسبتهم علي استهلاكهم بدقة العقار به وصلة أرضية</p>', 'ar', 6, NULL, '2022-01-20 14:26:47', '2022-01-22 11:00:29'),
(6, 'ترکیب عداد بدل تالف', '<p>تركيب عداد جديد بدلا من العداد العداد التالف</p>', 'ar', 7, NULL, '2022-01-20 14:26:47', '2022-01-22 11:04:17'),
(7, 'ترکیب عداد بدل فاقد', '<p>تركيب عداد جديد بدلا من العداد المفقود</p>', 'ar', 8, NULL, '2022-01-20 14:26:47', '2022-01-22 11:04:42'),
(8, 'تغيير اسم صاحب العداد', '<p>تغيير إسم المتعاقد علي العداد</p>', 'ar', 9, NULL, '2022-01-20 14:26:47', '2022-01-22 11:04:54'),
(9, 'طلب فحص عداد', '<p>فحص عداد مشترك بناء علي طلبه</p>', 'ar', 10, NULL, '2022-01-20 14:26:47', '2022-01-22 11:05:10'),
(10, 'طلب رفع عداد', '<p>طلب رفع العداد من المشترك</p>', 'ar', 11, NULL, '2022-01-20 14:26:47', '2022-01-22 11:05:29'),
(11, 'استبدال عداد بقدرة أكبر', '<p>طلب المنتفع تركيب عداد بقدرة أكبر يتناسب مع زيادة الاحمال عن القدرة المتعاقد عليها</p>', 'ar', 12, NULL, '2022-01-20 14:26:47', '2022-01-22 11:05:44'),
(12, 'تعديل توصيلة   داخلية - خارجية', '<p>طلب المنتفع تعديل توصيلة الكهرباء الخاصة به</p>', 'ar', 13, NULL, '2022-01-20 14:26:47', '2022-01-22 11:05:56'),
(13, 'جدولة مديونية على اقساط شهرية', '<p>طلب تقسيط المديونية علي اقساط شهرية عن المديونية المستحقة وليس تراكم الاستهلاك</p>', 'ar', 14, NULL, '2022-01-20 14:26:47', '2022-01-22 11:06:09'),
(14, 'توصيل التيار الكهربائي للمباني السكنية القانونية', '<p>توصيل التيار الكهربائي للمباني السكنية الصادر لها موافقة من الحي المختص علي التوصيل</p>', 'ar', 15, NULL, '2022-01-20 14:26:47', '2022-01-22 11:06:24'),
(15, 'توصيل التيار الكهربائي للمنشآت الاستثمارية', '<p>توصيل التيار الكهربي للمشروعات الاستثمارية</p>', 'ar', 16, NULL, '2022-01-20 14:26:47', '2022-01-22 11:06:39'),
(16, 'توصيل تيار مؤقت', '<p>توصيل الكهرباء بصفة مؤقتة لحين استكمال الإنشاءات</p>', 'ar', 17, NULL, '2022-01-20 14:26:47', '2022-01-22 11:06:52'),
(17, 'توصيل التيار الكهربائي للمباني غير القانونية', '<p>اتخاذ الاجراءات الفنية اللازمة لتأهيل المبني لتركيب العدادات الكودية المؤقته لقياس استهلاك الكهرباء الموصل بوسائل غير قانونية</p>', 'ar', 18, NULL, '2022-01-20 14:26:47', '2022-01-22 11:07:07'),
(18, 'سداد دفعة مقدمة تحت الحساب', '<p>قيام المشترك بسداد دفعة مقدمة تحت حساب استهلاك الكهرباء نظرا لتغيبه عن المكان أو رغبته في السداد مقدما</p>', 'ar', 19, NULL, '2022-01-20 14:26:47', '2022-01-22 11:07:19'),
(19, 'مبيعات لمبات LED', '<p>طلب شراء لمبات LED نقدا أو بالتقسيط</p>', 'ar', 20, NULL, '2022-01-20 14:26:47', '2022-01-22 11:07:33'),
(20, 'تغيير نوع النشاط المتعاقد عليه', '<p>رغبة المشترك في تغيير نوع النشاط المتعاقد عليه</p>', 'ar', 21, NULL, '2022-01-20 14:26:47', '2022-01-22 11:07:50'),
(21, 'تصحيح قراءة خاطئة', '<p>تصحيح القراءة الخاطئة بالإيصال</p>', 'ar', 22, NULL, '2022-01-20 14:26:47', '2022-01-22 11:08:03'),
(22, 'إبلاغ عن قراءة العداد', '<p>يمكن للمواطن إبلاغ قراءة العداد بنفسه من خلال قنوات متعددة من ضمنها : - الخط الساخن 121 الذي يعمل علي مدار الساعة - الموقع الإلكتروني لشركات التوزيع</p>', 'ar', 23, NULL, '2022-01-20 14:26:47', '2022-01-22 11:08:16'),
(23, 'سداد الفواتير عن طريق منافذ السداد الالكتروني', '<p>اتاحة السداد النقدي وغير النقدي لقيمة فواتير الكهرباء عبر منافذ السداد الإلكتروني في انحاء الجمهورية</p>', 'ar', 24, NULL, '2022-01-20 14:26:47', '2022-01-22 11:08:28'),
(24, 'شحن کارت مسبق الدفع', '<p>شحن كارت عداد مسبق الدفع من خلال مراكز تقديم الخدمة بشركات توزيع الكهرباء أو منافذ السداد الإلكتروني في انحاء الجمهورية</p>', 'ar', 25, NULL, '2022-01-20 14:26:47', '2022-01-22 11:08:42'),
(25, 'استخراج کارت شحن بدل تالف او بدل فاقد', '<p>طلب استخراج كارت شحن بدل تالف او بدل فاقد</p>', 'ar', 26, NULL, '2022-01-20 14:26:47', '2022-01-22 11:09:04'),
(26, 'تصحيح اسم وبيانات مشترك', '<p>طلب تصحيح اسم او بيانات بايصال استهلاك الكهرباء</p>', 'ar', 27, NULL, '2022-01-20 14:26:47', '2022-01-22 11:09:18'),
(27, 'تلقي الشكاوي والبلاغات', '<p>يتم تلقي الشكاوي الواردة عبر قنوات التواصل وإحالتها إلكترونيا إلي الجهات المختصة ومتابعة الرد عليها</p>', 'ar', 28, NULL, '2022-01-20 14:26:47', '2022-01-22 11:09:34'),
(28, 'تلقي الشكاوي عن طريق الخط الساخن', '<p>تقديم شكوي من خلال الخط الساخن 121</p>', 'ar', 29, NULL, '2022-01-20 14:26:47', '2022-01-22 11:10:24'),
(29, 'تلقي الشكاوي عن طريق تطبيق المحمول', '<p>تقديم شكوي من خلال تطبيق المحمول</p>', 'ar', 30, NULL, '2022-01-20 14:26:47', '2022-01-22 11:11:09'),
(30, 'تلقي الشكاوي عن طريق الرسائل القصيرة', '<p>تقديم شكوي من خلال الرسائل النصية</p>', 'ar', 31, NULL, '2022-01-20 14:26:47', '2022-01-22 11:11:26'),
(31, 'تلقي الشكاوي عن طريق الموقع الألكتروني', '<p>تقديم شكوي من خلال الموقع الألكتروني</p>', 'ar', 32, NULL, '2022-01-20 14:26:47', '2022-01-22 11:11:40'),
